sourcesContent:
import db from "../models"

export const getOneNewServices = (id) => new Promise(async (resolve, reject) => {
    try {
        const response = await db.findOne({
            where: id,
            raw: true
        })
        resolve({
            err: response ? 0 : 1,
            msg:response ? 'Get is successfully !' : 'get is faild',
            data: response ? response : null
        })
    } catch (error) {
        return reject(error)
    }
})

